import styled from "styled-components";

export const MainWrapper = styled.div`
  width: 100%;
  max-width: 1432px;
  height: 100%;
  min-height: 802px;
  background-color: rgba(28, 28, 28, 0.2);
  background-image: url(/img/header-bckg-1440.jpg);
  background-attachment: fixed;
  box-sizing: border-box;
`;
